import { BrowserRouter, Routes, Route } from "react-router-dom";
import "./App.css";
import Login from "./page/login/login";
import Register from "./page/register/register";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/login">
          <Login />
        </Route>
        <Route>
          <Register></Register>
        </Route>

      </Routes>
    </BrowserRouter>
  );
}

export default App;
